$(document).ready(function() {

    $('.span-button').on('click', function() {
        var $this = $(this),
            $li = $this.parent();

        $li.toggleClass('active');

        if ($li.hasClass('active')) {
            $this.text('-');
        } else {
            $this.text('+');
        }


    });

    var $harran = $('.advantage li'),
        $tables = $('.table');

    $harran.on('click', function() {
        $harran.removeClass('gr');
        
        var $this = $(this),
            className = $this.attr('class').split('-')[1],
            tableName = 'table-';

        $this.addClass('gr');

        $tables.removeClass('active');
        $('.' + tableName + className).addClass('active');
        console.log('.' + tableName + className);
    });

    var $images = $('.w100 img');
    var cdn = window.cdn_path || '';

    $(window).resize(function() {
        var width = $(window).width(),
            path = cdn + 'images/diagramm';

        if (width < 1201) {
            path += '1';
        }

        $images.each(function(index) {
            $(this).attr('src', path + (index + 1) + '.png');
        });

        // if (width < 611) {
        //     $('.calculator').hide();
        // } else {
        //     $('.calculator').show();
        // }
    });

    $(window).resize();

    var $labels = $('label.ui-button');

    $labels.on('click', function() {
      $labels.removeClass('ui-state-active');
      $(this).addClass('ui-state-active');
    });

    $('.roster').slick({
        infinite: true,
        slidesToShow: 3,
        centerMode: true,
        dots: true,
        slidesToScroll: 1,
        responsive: [{
                breakpoint: 981,
                settings: {
                    slidesToShow: 2,
                    slidesToScroll: 1,
                }
            },
            {
                breakpoint: 767,
                settings: {
                    slidesToShow: 1,
                    slidesToScroll: 1,
                }
            }
        ]
    });

    $('.slick-arrow').text('');
    // var gl = 0,
    //     $cur = $('#cur'),
    //     $des = $('#des'),
    //     $tim = $('#tim'),
    //     $weight = $('.input[name="weight"]');

    // $('input[name="desired"]').on('input', function() {
    //     var $this = $(this),
    //         min = 40,
    //         max = $weight.val() || 120;

    //     console.log(+$this.val());

    //     if (+$this.val() < min || +$this.val() > max) {
    //         $des.text($this.val() + 'kg');
    //     }
    // });

    // $('input[name="desired"]').on('input', function() {});

    // $('.ui-slider-handle').append('<span class="circle">0</span>');
    // var $text = $('');

    // function faze(stage) {

    // }

    var phone_format,mes,typePoh=4,weigh=60,desired=40, calc=0;

       
    mes = parseInt($('#tim').text());

    slider(weigh,desired,typePoh);
    $("#intensity").selectmenu();
    $('label[for="radio1"]').click();
    $(window).scrollTop(0);

    $('#intensity, input[name="weight"], input[name="desired"]').change(function(){
        update(typePoh);
    });

    $('.ui-slider-handle ').text(0);

    $('.calc').click(function(){
        calc=1;
    })
    // calc
    $('label[for^=radio]').click(function(event) {
        $('.ui-slider-handle').text(0);
        $("#slider_vertical").slider({ value: '0' });
        // $('.ui-slider-handle').css('margin-bottom', '-37px');
        $('div.thickness').css('opacity', '1');
        if ($(this).prev().val() == 'man') {
            $('div.thickness').css({
                // 'width': '177px',
                // 'height': '451px',
                'background-image': 'url("' + cdn +'images//man_fat.png")'
            });
            $('div.man').css({
                // 'width': '179px',
                // 'height': '452px',
                'background-image': 'url("' + cdn +'images//man.png")'
            });
        } else {
            $('div.thickness').css({
                // 'width': '137px',
                // 'height': '450px',
                'background-image': 'url("' + cdn +'images//woman_fat.png")'
            });
            $('div.man').css({
                // 'width': '139px',
                // 'height': '452px',
                'background-image': 'url("' + cdn +'images//woman.png")'
            });
        }
    }); 


    $('#intensity').selectmenu({
        change: function( event, data ) { 
            typePoh = data.item.value;
            $('.ui-slider-handle').text(0);
            $("#slider_vertical").slider({ value: '0' });
            $('.ui-slider-handle').css('margin-bottom', '-37px');
            $('div.thickness').css('opacity', '1');
            update(typePoh);
        }
    });



function update(typePoh) {
    var weigh = $('input[name="weight"]').val();
    var desired = $('input[name="desired"]').val();
    console.log(weigh,typePoh);
    if (desired == '' || weigh == '') {
        $('#cur').text('60 kg');
        $('#des').text('40 kg');
        $('#tim').text('5 mesi');
    }
    else {
            $('#cur').text(weigh+' kg');
            $('#des').text(desired+' kg');
            $('#tim').text(mes+' mesi');
        slider(weigh,desired,typePoh);
    }
    if(typePoh == '4'){
        $('.drop-count').html('10');
    } else if(typePoh == '6'){
        $('.drop-count').html('20');
    }
}

$('.calculator input[type="text"]').on('input', removeSpaces);

function removeSpaces() { $(this).val($(this).val().replace(/[^\d/]+/g, '')); }

function slider(weigh,desired,typePoh) {
    //console.log(mes);
    mes = parseInt((weigh - desired)/typePoh);
    mesText = ((weigh - desired)/typePoh).toFixed(0);
    $('#cur').text(weigh+' kg');
    $('#des').text(desired+' kg');
    $('#tim').text(mesText+' mesi');
    var cur = parseInt($('#cur').text());
    var des = parseInt($('#des').text());
    $("#slider_vertical").slider({
        orientation: "vertical",
        range: "max",
        min: -mes,
        max: 0,
        value: 0,
        slide: function( event, ui ) {
            var now = ui.value - (ui.value*2);
            var step1 = 1/mes;
            var marg1 = (30-3)/mes;
            var opacity1 = 1 - now * step1;
            var margin1 = (30 - now * marg1)+7;

            var curs = cur-now*typePoh;                 

            $('.ui-slider-handle ').css('margin-bottom', '-'+margin1+'px');
            $('div.thickness').css('opacity', opacity1);
            $('.ui-slider-handle ').text(now);
            $('#cur').text(curs+' kg');
        }
    });
}

$('input[name="weight"]').on('change', function() {
    var $this = $(this),
        value = $this.val();

    if (value <= 40 || value > 180) {
        $this.val('');
    }
});

$('input[name="growth"]').on('change', function() {
    var $this = $(this),
        value = $this.val();

    if (value < 140 || value > 230) {
        $this.val('');
    }
});

$('input[name="age"]').on('change', function() {
    var $this = $(this),
        value = $this.val();

    if (value < 16 || value > 100) {
        $this.val('');
    }
});

$('input[name="desired"]').on('change', function() {
    var $this = $(this),
        value = $this.val(),
        weight = $('input[name="weight"]').val();

    if (value < 40 || value > 240 || value > weight) {
        $this.val('');
    }
});




});

